import React from "react"
import logo from '../logo.svg';

export default function Header(props){
  return(
    <div>
      <header class="container">
        <div class="row">
          <div class="col-md-4">
            <img src={logo} alt="logo" />
          </div>
        </div>
      </header>
    </div>
  )
}
